import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First perform a search to get to a page with price filter
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.products-grid, .products-list', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // Apply price range filter
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');
    await page.click('.apply-filter');

    // Wait for filter to be applied
    await page.waitForTimeout(1000); // Brief pause for UI update

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_filter.png'));

    // Extract filter values to verify
    const minPriceValue = await page.$eval('#minPrice', el => el.value);
    const maxPriceValue = await page.$eval('#maxPrice', el => el.value);

    return {
      success: true,
      action: "Applied price range filter from $50 to $200",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
